import React, { Component } from 'react';





class Thanks extends Component {

  render() {
    return (
        <div style={{textAlign:'center'}}>
        	<h2>Thanks!</h2>
         	<h1>Your 1099 is Ready for Download</h1>
         	<button>Download 1099 PDF</button>
         	<br/>
         	<h6>Order Number is : 193839834834</h6>
         	<h6>You will recieve an email confirmation shortly</h6>

        </div>
    );
  }

}

export default Thanks;
